INSERT INTO `npc_text` SET `ID`=14794,`prob0`=1,`text0_0`='',`text0_1`='Justicar Mariel Trueheart has asked us to help administer and defend the tournament now that the coliseum is complete. She wants us to work with those worthless Silver Covenant curs, but they''re just getting in the way.',`lang0`=0,`em0_0`=0,`em0_1`=0,`em0_2`=0,`em0_3`=0,`em0_4`=0,`em0_5`=0;
