INSERT INTO `npc_text` SET `ID`=14053,`prob0`=1,`text0_0`='Woah, woah, woah! Keep it down, $N. Keep it down!$B$B<Blast looks around.>$B$BWe don''t want those frosty vrykul noticing us, now do we?$B$BWhat do you think of my jumpbot? I based it off of the mechagnome. Pretty slick, huh?',`text0_1`='',`lang0`=0,`em0_0`=0,`em0_1`=5,`em0_2`=0,`em0_3`=0,`em0_4`=0,`em0_5`=0;
INSERT INTO `npc_text` SET `ID`=14061,`prob0`=1,`text0_0`='Well you''re an ugly one! Don''t mean you don''t know how to fight though.$B$BOne of my squads should be geared and ready to march soon - get your sorry butt in line and make the climb with them!',`text0_1`='',`lang0`=0,`em0_0`=0,`em0_1`=0,`em0_2`=0,`em0_3`=0,`em0_4`=0,`em0_5`=0;
INSERT INTO `npc_text` SET `ID`=14561,`prob0`=1,`text0_0`='',`text0_1`='This is awful! I shouldn''t be sitting here, useless, when there''s so much to be done! If only my arm hadn''t gotten injured up in Northrend... No use dwelling on it, though! Tahu will have me patched up and cured eventually, and we''ll still help around here in the meantime.
INSERT INTO `npc_text` SET `ID`=14815,`prob0`=1,`text0_0`='That fight was savage and brutal. I haven''t seen a grand melee like that in many years! Amazing!',`text0_1`='',`lang0`=0,`em0_0`=0,`em0_1`=1,`em0_2`=0,`em0_3`=0,`em0_4`=0,`em0_5`=0;
